// Mock VAPI call responses - simulates real call outcomes
// This randomly generates realistic responses for testing all three outcomes

const outcomes = ['A', 'B', 'C'];
const randomOutcome = outcomes[Math.floor(Math.random() * outcomes.length)];

// Get lead data from previous nodes
const leadData = {
  leadName: $input.first().json.fields['Full Name'],
  leadEmail: $input.first().json.fields.Email,
  leadPhone: $input.first().json.fields.Phone,
  businessNiche: $input.first().json.fields['Business Niche'],
  monthlyRevenue: $input.first().json.fields['Monthly Revenue'],
  bottleneck: $input.first().json.fields['Biggest Bottleneck'],
  source: $input.first().json.fields.Source,
  submissionDate: $input.first().json.fields['Submission Date']
};

// Generate mock response based on random outcome
let mockResponse;

if (randomOutcome === 'A') {
  // Outcome A: Qualified Lead
  const intentRand = Math.random();
  const urgencyRand = Math.random();
  const qualityRand = Math.random();
  const bookingRand = Math.random();

  mockResponse = {
    vapiCallId: 'mock_call_' + Date.now(),
    callStatus: 'Completed',
    callDuration: Math.floor(Math.random() * 120) + 180, // 3-5 minutes

    // Structured outputs (CAPITALIZED for Airtable dropdowns)
    callSummary: `${leadData.leadName} runs a ${leadData.businessNiche} business generating ${leadData.monthlyRevenue} monthly. Main bottleneck: ${leadData.bottleneck}. Highly motivated to implement solutions immediately.`,
    callOutcome: 'A',
    intentLevel: intentRand > 0.7 ? 'High' : intentRand > 0.3 ? 'Medium' : 'Low',
    urgencyLevel: urgencyRand > 0.6 ? 'Immediate' : urgencyRand > 0.3 ? 'Near Term' : urgencyRand > 0.1 ? 'Future' : 'None',
    revenueTier: leadData.monthlyRevenue.includes('25') ? '25k+' : 
                 leadData.monthlyRevenue.includes('10') ? '10k-25k' : 
                 leadData.monthlyRevenue.includes('5') ? '5k-10k' : 
                 leadData.monthlyRevenue.includes('Less') ? '<5k' : 'Pre-revenue',
    responseQuality: qualityRand > 0.6 ? 'Clear' : qualityRand > 0.3 ? 'Mixed' : 'Vague',
    bookingAttempted: true,
    bookingStatus: bookingRand > 0.4 ? 'Booked' : 'Not Booked',
    bookingReason: bookingRand > 0.4 ? '' : 'Lead needs to check calendar first',
    objectionsRaised: Math.random() > 0.6 ? 'None' : 'Concerned about pricing, wants to see ROI first',
    callbackRequested: false,
    // Calendar booking details (for Outcome A with Booked status)
meetingScheduled: bookingRand > 0.4, // true if booked
meetingDateTime: bookingRand > 0.4 ? new Date(Date.now() + (Math.floor(Math.random() * 7) + 1) * 24 * 60 * 60 * 1000).toISOString() : null, // Random date 1-7 days from now
meetingLink: bookingRand > 0.4 ? 'https://meet.google.com/abc-defg-hij' : null, // Mock Google Meet link
    // Include original lead data
    ...leadData
  };

} else if (randomOutcome === 'B') {
  // Outcome B: Warm but Not Ready
  const intentRand = Math.random();
  const urgencyRand = Math.random();

  mockResponse = {
    vapiCallId: 'mock_call_' + Date.now(),
    callStatus: 'Completed',
    callDuration: Math.floor(Math.random() * 90) + 120, // 2-3.5 minutes

    callSummary: `${leadData.leadName} is interested in scaling their ${leadData.businessNiche} business but still in exploration phase. Revenue: ${leadData.monthlyRevenue}. Not urgent, wants to gather information first.`,
    callOutcome: 'B',
    intentLevel: intentRand > 0.5 ? 'Medium' : 'Low',
    urgencyLevel: urgencyRand > 0.5 ? 'Near Term' : 'Future',
    revenueTier: leadData.monthlyRevenue.includes('25') ? '25k+' : 
                 leadData.monthlyRevenue.includes('10') ? '10k-25k' : 
                 leadData.monthlyRevenue.includes('5') ? '5k-10k' : 
                 leadData.monthlyRevenue.includes('Less') ? '<5k' : 'Pre-revenue',
    responseQuality: 'Mixed',
    bookingAttempted: false,
    bookingStatus: 'Not Applicable',
    bookingReason: 'Lead not ready for strategy call yet',
    objectionsRaised: Math.random() > 0.5 ? 'Wants to see pricing first, bootstrapping heavily' : 'Still figuring things out, no clear timeline',
    callbackRequested: Math.random() > 0.7,

    ...leadData
  };

} else {
  // Outcome C: Not Qualified
  mockResponse = {
    vapiCallId: 'mock_call_' + Date.now(),
    callStatus: 'Completed',
    callDuration: Math.floor(Math.random() * 60) + 60, // 1-2 minutes

    callSummary: `${leadData.leadName} is pre-revenue or very early stage in ${leadData.businessNiche}. Not ready for agency partnership. Lacks clear business foundation or urgency.`,
    callOutcome: 'C',
    intentLevel: 'Low',
    urgencyLevel: 'None',
    revenueTier: 'Pre-revenue',
    responseQuality: 'Vague',
    bookingAttempted: false,
    bookingStatus: 'Not Applicable',
    bookingReason: 'Lead does not meet qualification criteria',
    objectionsRaised: Math.random() > 0.5 ? 'No budget, just researching' : 'Pre-revenue, still planning business',
    callbackRequested: false,

    ...leadData
  };
}

return [mockResponse];
